<template>
	<view class="pages-content">
		<view class="location-group">
			<p class="location-loca">{{barDetail.location}}</p>
			<p class="location-len">
				<image class="location-img" src="../../static/img/main/entertain/map.svg"></image>
				<text>距離你的位置1km</text>
			</p>
			<image class="location-target" src="../../static/img/main/entertain/target.svg" @tap="openLocation()"></image>
		</view>
		<p class="bar-title">{{barDetail.name}}</p>
		<p class="bar-phone">
			<image class="bar-icon-phone" src="../../static/img/main/entertain/icon-phone.png"></image>
			<text class="bar-text-phone">{{barDetail.phone}}</text>
		</p>
		<P class="bar-title">酒吧介紹</p>
		<p class="bar-intro">{{barDetail.intro}}</p>
		<p class="bar-title">酒吧環境</p>
		<image class="bar-pic" :src="barDetail.picture" mode="aspectFill"></image>
	</view>
</template>

<script>
	export default {
		data() {
			return {
				barDetail: ''
			}
		},
		methods: {
			openLocation() {
				uni.getLocation({
					type: 'gcj02', //返回可以用于uni.openLocation的经纬度
					success: function (res) {
						const latitude = res.latitude;
						const longitude = res.longitude;
						uni.openLocation({
							latitude: latitude,
							longitude: longitude,
							success: function () {
								console.log('success');
							}
						});
					}
				});
			}
		},
		onLoad(options) {
			// console.log(JSON.parse(options.itemStr));
			this.barDetail = JSON.parse(options.itemStr);
		}
	}
</script>

